@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix atm: <http://lod.csd.auth.gr/atm/atm.ttl#> .

atm:Transaction a rdfs:Class .

atm:processTransaction a rdf:Property ;
    rdfs:domain atm:Bank ;
    rdfs:range atm:Transaction .

atm:receiveRequest a rdf:Property ;
    rdfs:domain atm:ATM ;
    rdfs:range atm:Transaction .

atm:ATM a rdfs:Class ;
    rdfs:subClassOf [ a owl:Restriction ;
                      owl:onProperty atm:receiveRequest ;
                      owl:someValuesFrom atm:Transaction ] .

atm:Bank a rdfs:Class ;
    rdfs:subClassOf [ a owl:Restriction ;
                      owl:onProperty atm:processTransaction ;
                      owl:someValuesFrom atm:Transaction ] .
